import React from "react";
import client from "../contentful";
import FoodPost from "../components/foodPost/index.js";

const Home = () => {
  const [posts, setPosts] = React.useState(null);

  React.useEffect(() => {
    client
      .getEntries({
        content_type: "food",
      })
      .then((entries) => {
        setPosts(entries.items);
      });
  }, []);

  return (
    posts &&
    posts.map((post, i) => {
      return <h1> HEJHEJHEJ </h1>;
    })
  );
};

export default Home;
